import subprocess, sys, random, time
from functools import lru_cache

sys.setrecursionlimit(10000)

def brute_force(arr):
    n = len(arr)
    @lru_cache(None)
    def dp(mask):
        idxs = [i for i in range(n) if (mask>>i)&1]
        m = len(idxs)
        if m <= 1:
            return 0
        best = 0
        for k in range(m-1):
            i = idxs[k]; j = idxs[k+1]
            new_mask = mask & ~(1<<i) & ~(1<<j)
            best = max(best, abs(arr[i]-arr[j]) + dp(new_mask))
        return best
    return dp((1<<n)-1)


def run_solution(arr, timeout=5):
    inp = str(len(arr)) + '\n' + ' '.join(map(str, arr)) + '\n'
    p = subprocess.Popen([sys.executable, 'solution.py'], stdin=subprocess.PIPE, stdout=subprocess.PIPE, stderr=subprocess.PIPE, text=True)
    try:
        out, err = p.communicate(inp, timeout=timeout)
    except subprocess.TimeoutExpired:
        p.kill()
        return None, 'timeout'
    if p.returncode != 0:
        return None, err
    try:
        return int(out.strip()), err
    except:
        return None, out+err

random.seed(1)
all_ok = True
for n in range(2, 13):
    for t in range(20):
        arr = [random.randint(1, 20) for _ in range(n)]
        correct = brute_force(arr)
        res, err = run_solution(arr, timeout=3)
        if res is None:
            print('N', n, 'INPUT', arr, 'SOLUTION TIMEOUT or ERROR:', err)
            all_ok = False
            break
        if res != correct:
            print('N', n, 'INPUT', arr, 'EXPECTED', correct, 'GOT', res)
            all_ok = False
            break
    if not all_ok:
        break

print('ALL SMALL TESTS OK' if all_ok else 'SOME FAILED')
